import "./UserProfileCard.css";
import React from "react";
import {
  Card,
  ListGroup,
  ListGroupItem,
  Button,
  Accordion,
  Col,
} from "react-bootstrap";

const UserProfileCard = props => {
  return (
    <Col xl={3}>
      <Card style={{ width: "20.5rem" }} className="cardProfile">
        <div id="imageSettings">
          <Card.Img
            variant="top"
            src={props.userData.profileImg}
            alt="profile"
          />
        </div>
        <Card.Body>
          <Card.Title className="text-center">
            {props.userData.username}
          </Card.Title>
        </Card.Body>
        <ListGroup className="list-group-flush" id="profileCard__body">
          
          <Button variant="transparent" className="pt-3">
            <h6>Create new event</h6>
          </Button>
          <ListGroupItem className="text-center">
            <h6>No current Events to show or created events</h6>
          </ListGroupItem>
        </ListGroup>
      </Card>
      <ListGroup defaultActiveKey="#link1">
        <ListGroup.Item action>Link 1</ListGroup.Item>
        <ListGroup.Item action>Link 2</ListGroup.Item>
        <ListGroup.Item action>This one is a button</ListGroup.Item>
      </ListGroup>
    </Col>

    
  );
};

export default UserProfileCard;
